import './App.css';
import data from './data';
import Display from './Display';

function App() {

  console.log(Display);
  function printConsole() {
    data.forEach(function (item) {
      console.log(item.name, item.price, item.pictures, item.seller);
    })
  };

  printConsole();

  return (
    <div className="App">

      <section>
      <div>
        <Display name={data[0].name}
          price={data[0].price}
          pictures={data[0].pictures}   
          />
      </div>
      <div>{data[0].seller.name}</div>
      <div>{data[0].seller.firstName}</div> 
      </section>

    <section>

      <div>
        <Display name={data[1].name} 
        price={data[1].price} 
        pictures={data[1].pictures} />
      </div>
    </section>

      <section>

      <div>
        <Display name={data[2].name} 
        price={data[2].price} 
        pictures={data[2].pictures} />
      </div>
      </section>

<section>

      <div>
        <Display name={data[3].name} 
        price={data[3].price} 
        pictures={data[3].pictures} />
      </div>
</section>

<section>

      <div>
        <Display name={data[4].name} 
        price={data[4].price} 
        pictures={data[4].pictures} />
      </div>

</section>

    </div>
  );
}

export default App;
